script: |
  super -f text -I q3589.spq | sort > q3589.out

inputs:
  - name: q3589.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE + - col0 NOT IN ( + + 63, + col2, col0 + - + col1, + 73 * - 30, - + col0 + - col2, + - col2 + + 37 );
  - name: tab1

outputs:
  - name: q3589.out
    data: |
      51	14	96
      85	5	59
      91	47	68
